/* eslint-disable no-unused-vars */
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

const print = (
  productsCookies,
  cl,
  dni,
  email,
  referencia,
  direccion,
  pay,
  billNumber,
  billType,
  sum,
  discount,
  ruc,
  razonSocial
) => {
  // Obtener la fecha
  let today = new Date();
  let dd = String(today.getDate()).padStart(2, "0");
  let mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
  let yyyy = today.getFullYear();

  // Obtener la hora
  function addZero(i) {
    if (i < 10) {
      i = "0" + i;
    }
    return i;
  }
  let h = addZero(today.getHours());
  let m = addZero(today.getMinutes());
  let s = addZero(today.getSeconds());
  let time = h + ":" + m + ":" + s;

  let infoBill = [];
  let total = sum.toFixed(2);
  let subtotal = (sum / 1.18).toFixed(2);
  let igv = (subtotal * 0.18).toFixed(2);
  const pdf = new jsPDF("p", "mm", "a4");
  // eslint-disable-next-line no-undef
  require("jspdf-autotable");

  // cuadrado en el pdf
  pdf.rect(143, 15, 40, 16);

  // muestra ruc en el pdf
  pdf.setFontSize(10);
  pdf.text(145, 20, "R.U.C.: 20604470081");

  // condicional para el tipo de factura en el pdf
  if (billType === 1) {
    pdf.setFontSize(15);
    pdf.text(145, 25, "Nota de Venta");
  } else if (billType === 2) {
    pdf.setFontSize(15);
    pdf.text(145, 25, "Boleta de Venta");
  } else if (billType === 3) {
    pdf.setFontSize(15);
    pdf.text(145, 25, "Factura");
  } else if (billType === 4) {
    pdf.setFontSize(15);
    pdf.text(145, 25, "Cotización");
  } else {
    pdf.setFontSize(15);
    pdf.text(159, 25, "");
  }

  // muestra numero de factura
  pdf.setFontSize(10);
  pdf.text(
    145,
    29,
    `Nº ${billNumber[0].serieDoc + "-" + billNumber[0].nroDoc}`
  );

  const logo =
    "data:image/png;base64,";

  const logoBcp =
    "data:image/png;base64,";

  const QRyape =
    "data:image/jpeg;base64,";

  const logoYape =
    "data:image/png;base64,";

  // agrega logo de la empresa
  pdf.addImage(logo, "JPEG", 10, 10, 30, 30);

  // muestra nombre de empresa
  pdf.setFontSize(15);
  pdf.text(45, 20, "IMPORTACIONES NOARG E.I.R.L");

  // muestra direccion de empresa
  pdf.setFontSize(10);
  pdf.text(45, 25, "Dirección: Calle la mar 299 - Ica");

  // muestra telefono de empresa
  pdf.setFontSize(10);
  pdf.text(45, 30, "Tlf: 993-208-412 / 936-600-625");

  // muestra una linea
  pdf.line(20, 45, 85, 45);

  // muestra informacion del cliente
  pdf.setFontSize(10);
  dni.length > 0 && pdf.text(20, 50, `Cliente: ${cl} \nDNI: ${dni}`);
  ruc && ruc.length > 0 && pdf.text(20, 50, `Cliente: ${cl}`);
  pdf.text(20, 60, `Email: ${email ? email : ""}`);
  pdf.text(20, 65, `Dirección: ${direccion ? direccion : ""}`);
  pdf.text(20, 70, `Referencia: ${referencia ? referencia : ""}`);

  // condicional para ruc y razon social
  if (billType === 1 || billType === 2) {
    pdf.setFontSize(10);
    pdf.text(20, 85, ``);
    pdf.setFontSize(10);
    pdf.text(20, 90, ``);
  } else {
    // Muestra RUC
    pdf.setFontSize(10);
    pdf.text(20, 75, `RUC: ${ruc}`);
    // Muestra Razon Social
    pdf.setFontSize(10);
    pdf.text(20, 80, `Razón Social: ${razonSocial}`);
  }

  // muestra la fecha
  pdf.setFontSize(10);
  pdf.text(
    20,
    75,
    `Fecha Emision: ${dd + "/" + mm + "/" + yyyy} Hora: ${time}`
  );

  // lista de informacion de la venta
  let info = [];
  if (billType === 4) {
    info = [
      "\n" +
        "Valor Venta:   S/ " +
        subtotal +
        "\n" +
        "Descuento:     S/ " +
        discount +
        "\n" +
        "IGV 18%:        S/ " +
        igv +
        "\n" +
        "Importe Total: S/ " +
        total,
    ];
  } else {
    info = [
      "\n" +
        "Valor Venta:   S/ " +
        subtotal +
        "\n" +
        "Descuento:     S/ " +
        discount +
        "\n" +
        "IGV 18%:        S/ " +
        igv +
        "\n" +
        "Importe Total: S/ " +
        total +
        "\n" +
        "Pago con:       S/ " +
        pay +
        "\n" +
        "Vuelto:            S/ " +
        (pay - total).toFixed(2),
    ];
  }
  infoBill.push(info);

  // Valores de cada fila
  const result_table = [];
  for (let x = 0; x < productsCookies.length; x++) {
    let name = [
      productsCookies[x].codProd,
      productsCookies[x].nombreProducto,
      productsCookies[x].ubicacion,
      productsCookies[x].cantidad,
      "S/ " + productsCookies[x].precioVenta,
      "S/ " +
        (productsCookies[x].precioVenta * productsCookies[x].cantidad).toFixed(
          2
        ),
    ];
    // agrega cada valor al array vacio
    result_table.push(name);
  }

  // genera la tabla en pdf
  pdf.autoTable({
    margin: { top: 85, left: 3, right: 3 },
    theme: "grid",
    head: [["Código", "Nombre", "Ubicacion", "Cant.", "Precio", "Total"]],
    body: result_table,
    columnStyles: {
      halign: "center",
      0: { cellWidth: 20 },
      3: { cellWidth: 13 },
      4: { cellWidth: 15 },
      5: { cellWidth: 16 },
    },
    headStyles: {
      lineColor: [0, 0, 0],
      textColor: [0, 0, 0],
      fillColor: [200, 204, 201],
      lineWidth: 0.1,
    },
    bodyStyles: { lineColor: [0, 0, 0], textColor: [0, 0, 0], fontSize: 7 },
    didDrawCell: function (data) {
      data.settings.margin.top = 10;
    },
  });

  // final de la tabla
  let finalY = pdf.lastAutoTable.finalY;

  // agrega logo de BCP
  pdf.addImage(logoBcp, "JPEG", 20, finalY + 30, 30, 12);

  // texto cuentas
  pdf.text(
    15,
    finalY + 45,
    `
    Mi número de cuenta BCP Soles es 3802552369086.
    Mi número de cuenta interbancaria es 00238000255236908642.
    Mi número de cuenta BCP Dólares es 3802519002157.
    Mi número de cuenta interbancaria es 00238000251900215743.
  `
  );

  // agrega qr de yape
  pdf.addImage(QRyape, "JPEG", 165, finalY + 30, 30, 30);

  // agrega logo de yape
  pdf.addImage(logoYape, "JPEG", 150, finalY + 40, 10, 10);

  // agrega telefono de yape
  pdf.setFontSize(8);
  pdf.text(142, finalY + 55, "Telf: 993-208-412");

  // cuadrado en el pdf
  pdf.setDrawColor(0);
  pdf.setFillColor(214, 212, 212);
  pdf.rect(163, finalY, 44, 25, "FD");

  // Muestra: Monto a pagar, Descuento, Total a pagar, Pago con, Vuelto.
  pdf.setFontSize(8);
  pdf.text(170, finalY + 2, `${infoBill.join("")}`);

  pdf.save(`venta-${billNumber[0].serieDoc + "-" + billNumber[0].nroDoc}`);
};

export default print;
